import React from 'react'
import {Grid, Segment} from 'semantic-ui-react'

import pokemon from './pokemonDatabase.json'

import * as R from 'ramda'

function App() {
  return (
    <Grid>
      <Grid.Row>
        <Grid.Column width={10}>
          <Segment basic>
          {
            R.map(
              ({name, pokedex_number}) => (
                <Segment key={pokedex_number}>
                {`${pokedex_number} ${name}`}
                </Segment>
              ),
              pokemon
            )
          }
          </Segment>
        </Grid.Column>
        <Grid.Column width={6}>Column2</Grid.Column>
      </Grid.Row>
    </Grid>
  )
}

export default App;
